                method: 'GET',
                // mode: "no-cors",
            })
            .then(
                 res => {
                    return res.json();
                }
            )
            .then(
                data => {
                    console.log(data);
                    cranny = data;
                }
            )
            .catch(
                (reason) => {
                    console.log("Error: \n" + reason);
                }
            )
            .finally(
                () => {
                    console.log("this is just a final signal.");
                }
            );

        console.log("CRANNY: \n" + cranny);





